import { Link } from 'react-router-dom';

function AdminDashboard() {
    const divStyle = {
        padding: '20px',
        backgroundColor: 'red',
        boxShadow: '10px 10px 10px 5px grey',
        marginTop: '10px'
    };

    return (
        <div style={divStyle}>
            <Link to="/addtrek" className="nav-link">Add Trek Details</Link>
        </div>
    );
}

export default AdminDashboard;
